function initMap(){const n={lat:59.9387192,lng:30.3208587},e=new google.maps.Map(document.querySelector(".map-google"),{center:n,zoom:17}),o=new google.maps.InfoWindow({content:"<h1>Cat Energe</h1><div><p>г. Санкт-Петербург ул. Большая Конюшенная д. 19/8, офис 101</p></div>"}),a=new google.maps.Marker({position:n,map:e,title:"Cat Energy",icon:{url:"../img/map-pin.png",scaledSize:new google.maps.Size(113,106)}});a.addListener("click",(()=>{o.open(e,a)}))}const nav=document.querySelector(".nav"),navBtn=nav.querySelector(".nav__btn");nav.classList.remove("nav--no-js"),navBtn.onclick=function(){nav.classList.toggle("nav--close"),nav.classList.toggle("nav--open")};